var SelectedCenter = "";
var SelectedSession = "";
var DateToDisplay = "";
var SelectedCategory = "";
var AvailableSessions;

function changeSelectedSession(selector)
{
    SelectedSession = selector[0].getAttribute('data-sessionLength');
    setSelectedSessionButton();
    displayAvailableBookingsBasedOnUserSelection();
}

function setSessionButtonsOnclickEventHandler()
{
    var availableSessionsAsString = document.getElementById('availableSessionsAsString').value;

    availableSessionsAsString = availableSessionsAsString.trim();
    AvailableSessions = availableSessionsAsString.split(" ");

    for (i = 0; i < AvailableSessions.length; i++)
    {
        $('#' + AvailableSessions[i] + 'Btn').on('click', null, function () { changeSelectedSession($(this)); });
    }
}

function setSelectedSessionButton()
{
    var sessionButton = document.getElementById(SelectedSession + 'Btn');
    sessionButton.className = "btn btn-primary";

    for (i = 0; i < AvailableSessions.length; i++)
    {
        if (AvailableSessions[i] === SelectedSession)
        {

            continue;
        }

        var otherButton = document.getElementById(AvailableSessions[i] + 'Btn');
        otherButton.className = "btn btn-light";
    }
}

function DisplayNextDayInCalendar()
{
    var momentToDisplay = moment(DateToDisplay, "MM/DD/YYYY HH:mm:ss");
    momentToDisplay.add(1, 'days');

    DateToDisplay = momentToDisplay.format("MM/DD/YYYY HH:mm:ss");
    displayAvailableBookingsBasedOnUserSelection();
    setValueForHeading();
}

function DisplayPreviousDayInCalendar()
{
    var momentToDisplay = moment(DateToDisplay, "MM/DD/YYYY HH:mm:ss");
    momentToDisplay.subtract(1, 'days');

    DateToDisplay = momentToDisplay.format("MM/DD/YYYY HH:mm:ss");
    displayAvailableBookingsBasedOnUserSelection();
    setValueForHeading();
}

function setValueForHeading()
{
    var dayHeading = document.getElementById('dayHeading');
    var monthHeading = document.getElementById('monthHeading');

    var momentToDisplay = moment(DateToDisplay, "MM/DD/YYYY HH:mm:ss"); 

    dayHeading.innerText = momentToDisplay.format("DD"); 
    monthHeading.innerText = momentToDisplay.format("MMMM");
}

function setDefaults()
{
    SelectedCenter = document.getElementById('selectedCenter').value;
    SelectedSession = document.getElementById('selectedSession').value;
    DateToDisplay = document.getElementById('dateToDisplay').value;
    SelectedCategory = document.getElementById('category').value;
}

function ChangeColorOfBookingButton(pressedBtn)
{
    var new_button = pressedBtn[0].cloneNode(true);
    new_button.className = "btn btn-primary bookingBTN";
    new_button.removeAttribute("data-toggle");
    new_button.removeAttribute("#serviceAddedModal");

    new_button.addEventListener('click', function ()
    {
       // window.location.href = "../cart/getcart";
    });

    pressedBtn[0].parentNode.replaceChild(new_button, pressedBtn[0]);  
}

