var displayPassedSlots = false;
function ToggleDisplayPassedSlots()
{
    var pastslotscontainer = document.getElementById('pastslotscontainer');
    var passedSlotsButton = document.getElementById('passedSlotsButton');
    if (displayPassedSlots)
    {
        displayPassedSlots = false;
        pastslotscontainer.hidden = false;
        passedSlotsButton.innerText = "Hide past";
    } else {
        displayPassedSlots = true;
        pastslotscontainer.hidden = true;
        passedSlotsButton.innerText = "Show past";
    }
}

